import React from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import Home from './Home';
import LiveFeed from './LiveFeed';
import Analytics from './Analytics';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

// Install the socket io client using:
//    npm install socket.io
//
// Then import socket io and create a socket:
//
import io from 'socket.io-client';
const socket = io('http://localhost:3001');
//
// See: https://socket.io/get-started/chat
//      https://www.npmjs.com/package/socket.io-client

class App extends React.Component {

  // Output all the posts into a table
  render() {
    return (
      <div>
        <Router>
        <div>
          <nav class="navbar navbar-expand-lg navbar-dark bg-dark">
          <div class="collapse navbar-collapse" id="navbar">
          <ul class="navbar-nav">
            <li class="nav-item"><Link to={'/'} className="nav-link"> Home </Link></li>
            <li class="nav-item"><Link to={'/LiveFeed'} className="nav-link">LiveFeed</Link></li>
            <li class="nav-item"><Link to={'/Analytics'} className="nav-link">Analytics</Link></li>
          </ul>
          </div>
          </nav>
          <hr />
          <Switch>
              <Route exact path='/' component={Home} />
              <Route path='/LiveFeed' component={LiveFeed} />
              <Route path='/Analytics' component={Analytics} />
          </Switch>
        </div>
      </Router>
      </div>
    );
  }
}

export default App;
